    //   manufacturericao: data.manufacturericao,
    //   manufacturername: data.manufacturername,
    //   model: data.model,
    //   typecode: data.typecode,
    //   serialnumber: data.serialnumber,
    //   linenumber: data.linenumber,
    //   icaoaircrafttype: data.icaoaircrafttype,
    //   operator: data.operator,
    //   operatorcallsign: data.operatorcallsign,
    //   operatoricao: data.operatoricao,
    //   operatoriata: data.operatoriata,
    //   owner: data.owner,
    //   testreg: data.testreg,
    //   registered: data.registered,
    //   reguntil: data.reguntil,
    //   built: data.built,
    //   firstflightdate: data.firstflightdate,
    //   seatconfiguration: data.seatconfiguration,
    //   engines: data.engines,
    //   }
    //   saveData(newAirData, 'tabledata.json')
    // }

  };

  return (
    <div>
      <div className="datainsert">
        <div className="datainsert__main-form">
          <h2>Enter Data Info</h2>
          <form onSubmit={handleAddFormSubmit}>
            <div className="datainsert__main-form--form-left">
              <input
                type="text"
                name="icao24"
                placeholder="Enter icao24"
                onChange={handleAddFormChange}
              />
              <br />
              <input
                type="code"
                name="registration"
                placeholder="Enter registration code"
                onChange={handleAddFormChange}
              />
              <br />
              <input
                type="text"
                name="manufacturericao"
                placeholder="Enter manufacturer icao"
                onChange={handleAddFormChange}
              />
              <br />
              <input
                type="name"
                name="manufacturername"
                placeholder="Enter manufacturer name"
                onChange={handleAddFormChange}
              />
              <br />
              <input
                type="text"
                name="model"
                placeholder="Enter model"
                onChange={handleAddFormChange}
              />
              <br />
              <input
                type="text"
                name="typecode"
                placeholder="Enter typecode"
                onChange={handleAddFormChange}
              />
              <br />
              <input
                type="code"
                name="serialnumber"
                placeholder="Enter serial number"
                onChange={handleAddFormChange}
